import React, { Component } from "react";
import { ListGroup, ListGroupItem } from "reactstrap";

export default class LeftMenu extends Component {
  state = {
    menuElements: [{ choiceName: "Login" }, { choiceName: "Register" }],
    currentCategory: "",
  };

  render() {
    return (
      <div>
        <h3>{this.props.info.title}</h3>
        <ListGroup>
          {this.state.menuElements.map((choice) => (
            <ListGroupItem key={choice.choiceName}>
              {choice.choiceName}
            </ListGroupItem>
          ))}
        </ListGroup>
      </div>
    );
  }
}
